import React, { useState, useEffect } from 'react';
import seidman from '../images/seidman.jpg';
import eboard1 from '../images/Eboard1.jpeg';
import eboard2 from '../images/Eboard2.jpg';

const images = [seidman, eboard1, eboard2];

const Home = ({ adminAccess }) => {
  const [currentImageIndex, setCurrentImageIndex] = useState(0);
  const [editMode, setEditMode] = useState(false);
  const [content, setContent] = useState({
    welcomeMessage: 'Welcome to the GVSU Real Estate Club',
    nextMeetingTitle: 'Next Meeting',
    nextMeeting: 'Join us for our next meeting on June 15th, 2024 at 6:00 PM in the Seidman College of Business, Room 101.',
    missionTitle: 'Our Mission',
    mission: 'Welcome to the Real Estate Club, where we bring together enthusiasts, professionals, and students passionate about the dynamic world of real estate. Our mission is to provide valuable insights, networking opportunities, and educational resources to help our members navigate the real estate industry effectively. Whether you are interested in residential, commercial, or industrial real estate, our club offers a platform for growth and development. Join us for informative seminars, engaging discussions, and hands-on workshops designed to enhance your understanding and skills in the real estate market.',
  });

  useEffect(() => {
    const interval = setInterval(() => {
      setCurrentImageIndex((prevIndex) => (prevIndex + 1) % images.length);
    }, 4000);

    return () => clearInterval(interval);
  }, []);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setContent((prevContent) => ({ ...prevContent, [name]: value }));
  };

  return (
    <div style={{ 
      fontFamily: 'Arial, sans-serif', 
      textAlign: 'center', 
      margin: '0 auto' 
    }}>
      <div 
        style={{ 
          position: 'relative',
          width: '100vw',
          height: '100vh',
          overflow: 'hidden',
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center',
          color: 'white',
        }}
      >
        {images.map((image, index) => (
          <img 
            key={index}
            src={image} 
            alt={`Slide ${index + 1}`} 
            style={{
              position: 'absolute',
              top: '0',
              left: '0',
              width: '100%',
              height: '100%',
              objectFit: 'cover',
              zIndex: '-1',
              opacity: currentImageIndex === index ? 1 : 0,
              transition: 'opacity 1s ease-in-out'
            }}
          />
        ))}
        <div
          style={{
            position: 'absolute',
            top: '0',
            left: '0',
            width: '100%',
            height: '100%',
            backgroundColor: 'rgba(0, 43, 128, 0.15)', // navy color with 15% opacity
            zIndex: '0'
          }}
        />
        {editMode ? (
          <textarea
            name="welcomeMessage"
            value={content.welcomeMessage}
            onChange={handleChange}
            className="text-4xl font-bold w-full p-2 mb-4"
            style={{ border: '1px solid #ccc', borderRadius: '4px', backgroundColor: 'rgba(0, 0, 0, 0.5)', color: 'white', outline: 'none', resize: 'none' }}
            rows={2}
          />
        ) : (
          <h1 className="text-4xl font-bold" style={{ textShadow: '2px 2px 4px rgba(0, 0, 0, 0.5)', zIndex: '1' }}>
            {content.welcomeMessage}
          </h1>
        )}
      </div>

      <div style={{ margin: '40px 0', padding: '20px' }}>
        {editMode ? (
          <textarea
            name="nextMeetingTitle"
            value={content.nextMeetingTitle}
            onChange={handleChange}
            className="text-4xl font-bold w-full p-2 mb-4"
            style={{ border: '1px solid #ccc', borderRadius: '4px', backgroundColor: 'rgba(0, 0, 0, 0.5)', color: 'white', outline: 'none', resize: 'none' }}
            rows={2}
          />
        ) : (
          <h2 className="text-4xl font-bold" style={{ padding: '20px' }}>{content.nextMeetingTitle}</h2>
        )}
        {editMode ? (
          <textarea
            name="nextMeeting"
            value={content.nextMeeting}
            onChange={handleChange}
            className="w-full p-2"
            rows="4"
            style={{ border: '1px solid #ccc', borderRadius: '4px', backgroundColor: 'rgba(0, 0, 0, 0.5)', color: 'white', outline: 'none' }}
          />
        ) : (
          <p>{content.nextMeeting}</p>
        )}
      </div>

      <section style={{ marginBottom: '20px', textAlign: 'left', width: '60%', margin: '0 auto' }}>
        {editMode ? (
          <textarea
            name="missionTitle"
            value={content.missionTitle}
            onChange={handleChange}
            className="text-4xl font-bold w-full p-2 mb-4"
            style={{ border: '1px solid #ccc', borderRadius: '4px', backgroundColor: 'rgba(0, 0, 0, 0.5)', color: 'white', outline: 'none', resize: 'none' }}
            rows={2}
          />
        ) : (
          <h2 className='text-4xl font-bold text-center' style={{ padding: '20px' }}>{content.missionTitle}</h2>
        )}
        {editMode ? (
          <textarea
            name="mission"
            value={content.mission}
            onChange={handleChange}
            className="w-full p-2"
            rows="6"
            style={{ border: '1px solid #ccc', borderRadius: '4px', backgroundColor: 'rgba(0, 0, 0, 0.5)', color: 'white', outline: 'none' }}
          />
        ) : (
          <p>{content.mission}</p>
        )}
      </section>

      {adminAccess && (
        <button
          onClick={() => setEditMode(!editMode)}
          className="bg-navy text-white py-2 px-4 rounded-lg mb-4"
        >
          {editMode ? 'Save' : 'Edit'}
        </button>
      )}

      <a 
        href="mailto:reclub@mail.gvsu.edu"
        style={{
          display: 'inline-block',
          padding: '10px 20px',
          backgroundColor: '#004B80',
          color: '#fff',
          textDecoration: 'none',
          border: 'none',
          borderRadius: '5px',
          cursor: 'pointer',
          fontSize: '16px',
          transition: 'background-color 0.3s',
          margin: '40px auto',
          whiteSpace: 'nowrap'
        }}
        className="hover:transform hover:scale-110 text-white font-bold py-2 px-4 mb-4"
      >
        Contact Us
      </a>
    </div>
  );
};

export default Home;
